import React from 'react';
import './css/Favorites.css'

function Favorites (props) {
  const mas = ["a", "b", "c"]
  console.log(mas)
  const questionList = mas.map((question) => <div key={question}>{question}</div>)
  return (
    <div className="favorites">
      {questionList}
    </div>
  )
}

export default Favorites;
